INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (91002, 36, 8, 100, "", "", 0, 40000, 1, 0, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (91002, 37, 8, 150, "ぺコリーヌ", "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 107501, 40001, 1, 1, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (91002, 38, 8, 150, "コッコロ", "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 107601, 40001, 2, 1, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (91002, 39, 8, 150, "キャル", "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 107801, 40001, 3, 1, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (91002, 40, 8, 150, "スズメ", "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 107701, 40001, 4, 1, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (91002, 41, 8, 150, "タマキ", "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 107901, 40001, 5, 1, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (91002, 42, 8, 150, "ぺコリーヌ", "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 107501, 40001, 6, 2, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (91002, 43, 8, 150, "コッコロ", "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 107601, 40001, 7, 2, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (91002, 44, 8, 150, "キャル", "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 107801, 40001, 8, 2, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (91002, 45, 8, 150, "スズメ", "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 107701, 40001, 9, 2, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (91002, 46, 8, 150, "タマキ", "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 107901, 40001, 10, 2, 0);
