INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (24001, 321, 2, 1, "リリ", "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 125801, 40011, 1, 1, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (24001, 322, 2, 1, "クリア", "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 126001, 40011, 2, 1, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (24001, 323, 2, 1, "プレシア", "んーと。\nこれ、あげる。\nはい", 126101, 40011, 3, 1, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (24001, 324, 2, 1, "リリ", "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 125801, 40011, 4, 2, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (24001, 325, 2, 1, "クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, 40011, 5, 2, 0);
INSERT INTO `v1_1d28b47372d27e72954b3ea6dea4f601d4fc58b8cbf0de38bfae7b9adebd5700` VALUES (24001, 326, 2, 1, "プレシア", "お兄。\nきてくれて、うれしい", 126101, 40011, 6, 2, 0);
